var CreateController = (function (view, dinnerModel) {
    // Initialize select options
    $('#selectType').material_select();

    // When select options change
    $('#selectType').on('change', function () {
        var dishType = $('#selectType :selected').text();
        var arg = { dishType: dishType, filter: '' };
        dinnerModel.notifyObservers({ type: RENDER_DISHES, arg: arg });
    });

    view.plusButton.addEventListener('click', function () {
        dinnerModel.setNumberOfGuests(dinnerModel.getNumberOfGuests() + 1);
    });

    view.minusButton.addEventListener('click', function () {
        dinnerModel.setNumberOfGuests(dinnerModel.getNumberOfGuests() - 1);
    });

    view.searchField.addEventListener('input', function (e) {
        var filter = e.target.value;
        var dishType = $('#selectType :selected').text();
        var arg = { filter: filter, dishType: dishType };
        dinnerModel.notifyObservers({ type: RENDER_DISHES, arg: arg });
    });
});

